    const hashPart = readIntFromBitString(cell.bits, 11, 256);
    if (n.toString(10) + ":" + hashPart.toString(16) === "0:0") return null;
    const s = n.toString(10) + ":" + hashPart.toString(16).padStart(64, "0");
